import React, { FC, ReactNode } from 'react';
import Header from './Header';

type propTypes = {
  children?: ReactNode,
}


const Layout:FC = ({ children }:propTypes) => {
  return (
  <React.Fragment>
    <p>Header</p>
    <Header />
    {children}
    <p>footer</p>
  </React.Fragment>
);
};

export default Layout;
